class ActorComponent {
    constructor(dbService) {
        this.dbService = dbService;
        this.actorsDB = [];
        this.fullName = "";
        this.section = 2;
        this.aid = 1;
    }
    ngOnInit() {
        this.onGetActors();
    }
    //get actors --> Observables
    onGetActors() {
        this.dbService.getActors().subscribe((data) => {
            this.actorsDB = data;
        });
    }
    onSaveActor() {
        let obj = { fullName: this.fullName, bYear: this.bYear };
        this.dbService.createActor(obj).subscribe(result => {
            this.onGetActors();
        });
    }
    //update an actor
    onSelectUpdate(item) {
        this.fullName = item.fullName;
        this.bYear = item.bYear;
        this.aid = item._id;
    }
    onUpdateActor() {
        let obj = { fullName: this.fullName, bYear: this.bYear };
        this.dbService.updateActor(this.aid, obj).subscribe(result => {
            this.onGetActors();
        });
    }
    //delete
    onDeleteActor(item) {
        this.dbService.deleteActor(item._id).subscribe(result => {
            this.onGetActors();
        });
    }
    changeSection(id) {
        this.section = id;
    }
    changeClass(id) {
        if (id == this.section)
            return "btn-primary";
        else
            return "btn-danger";
    }
}
